using System;
using System.Collections.Generic;
using System.Linq;
using Google.Protobuf;

namespace SecretSanta.Core.Domain.Contexts.Seeds;

public class Seeder
{
    public static List<Peeps> Peeps()
    {
        return NamesOutTheHat.Select(s => new Peeps()
        {
            name = s.Name,
            uniquePass = Services.Password.Generate(),
            pic = Services.ImageConversion.ToBase64(s.Picture),
            Year = "2022",
            WhatNo = true
        }).ToList();
    }

    public static settings Settings()
    {
        return new settings()
        {
            currentyear = DateTime.Now.ToString("yyyy"),
            admin = Services.Password.Generate()
        };
    }

    private static PersonDetails[] NamesOutTheHat = new PersonDetails[]
    {
        new (){Name = "Jerry", Picture = CRY},
        new (){Name = "Lisa", Picture = HOPE},
        new (){Name = "Patrick", Picture = PRESENT},
        new (){Name = "Joffrey", Picture = GENIE},
        new (){Name = "Larry", Picture = TREE},
    };

    public class PersonDetails
    {
        public string Name { get; set; }
        public string Picture { get; set; }
    }
    
    private const string CRY =
        "data:image/jpeg;base64, ";

    private const string GENIE = 
        "data:image/jpeg;base64, ";

    private const string HOPE = 
        "data:image/jpeg;base64, ";

    private const string PRESENT = 
        "data:image/jpeg;base64, ";

    private const string TREE = 
        "data:image/jpeg;base64, ";

}